<template name="Retronator.HQ.ArtStudio.Northeast">

        <div class="neukom-wip-1 neukom-wip-2 neukom-wip-3 {{artworkClasses 'neukom'}}"></div>
      </div>
      <div class="chair-front" data-origin-x="0" data-origin-y="1" data-depth="1"></div>
    </div>
